import React from 'react';
const Navigation = ({onRouteChange,isSignedIn})=>{
		if(isSignedIn){
			return(
				<nav style={{display:'flex' ,justifyContent:'flex-end'}}>
					<p onClick={()=>onRouteChange('signin')} className='f3 pa2 link underline dim black pointer' >Sign Out</p>
				</nav>
			);	
		}
		else{
			return(
			<nav style={{display:'flex' ,justifyContent:'flex-end'}}>
				<p onClick={()=>onRouteChange('signin')} className='f3 pa2 link underline dim black pointer' >Sign In</p>
				<p onClick={()=>onRouteChange('register')} className='f3 pa2 link underline dim black pointer' >Register</p>
			</nav>
		);
		}	
}
export default Navigation;
